export default function FormContainer() {
  return (
    <div className="row">
      <div className="col-sm-12">
        <form className="needs-validation" noValidate>
          <div className="form-row">
            <TextField/>
          </div>
          <button className="btn btn-primary" type="submit">Submit form</button>
        </form>
      </div>
    </div>
  );
}

function TextField(props){
  const {uid="fname", dataType="string", label="first name", value="maulik", _metadata: {required=false} = {}} = props;
  let fieldType = "text";

  switch(dataType){
    case "number":
      fieldType = "number";
      break;
    case "string":
    default:
      fieldType = "text";
      break;
  }

  return(
    <div className="col-sm-12 mb-3">
      <label htmlFor={uid}>{label}</label>
      <input type={fieldType} className="form-control" id={uid} placeholder={label} required={required}/>
      <div className="invalid-feedback">
        Please choose a username.
      </div>
    </div>
  )
}
